INSERT INTO `menu_contents_detail` (`LE_C_Slno`, `LE_C_EventId`, `LE_C_Content`, `LE_C_Type`, `LE_C_Position`, `LE_C_Status`) VALUES
(43, 36, '&lt;p&gt;Ganjam Law College was established in the Academic Year 1983-1984 under the Provisions of Society Registration Act, 1860 and subsequently the college is registered under The Indian Trusts Act, 1882 at the initiation of the Chairman, Dr. Nalini Kanta Samanta, LL.M, Ph. D. with the help of the Governing Body Members. The college is affiliated to Berhampur University and is recognized by Bar Council of India and Government of Odisha.&lt;br /&gt;\r\n&lt;strong&gt;The college is offering 3 Years LL.B course.&lt;/strong&gt; The Ganjam Law College is having its own three storied building on Ambapua Road, Berhampur Town, Odisha. The College is having well &amp;ndash; equipped library, play ground and own bus facilities to carry students to the college from different parts of Berhampur town. The College has highly qualified Principal, Prof. (Dr.) N. S. J. Rao, B. Sc., M.A., LL.M., Ph.D.(Law), D.Litt. (Law) and Academic Director, Dr. Yugal Kishore, M.Sc., LL.M., Ph. D. (Law) and adequate qualified teaching staffs and Non-teaching staffs.&lt;br /&gt;\r\n&lt;br /&gt;\r\nThe key to our success is that we care our students and over the years we have developed an excellent academic environment to support our students during their study.&lt;/p&gt;\r\n', 'Text', 1, 1),
(45, 39, '&lt;ul&gt;\r\n	&lt;li&gt;New Pattern qualitative teaching by highly experienced faculties &amp;amp; visiting faculties.&lt;/li&gt;\r\n	&lt;li&gt;&amp;nbsp;Highly qualified faculties.&lt;/li&gt;\r\n	&lt;li&gt;&amp;nbsp;Weekly Assessment Tests and Semester system Examinations (Two in a year) with the &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;provision of Internal Assessment.&lt;/li&gt;\r\n	&lt;li&gt;Clearing of doubts at any point of time.&lt;/li&gt;\r\n	&lt;li&gt;&amp;nbsp;Holding parent&amp;rsquo;s meetings.&lt;/li&gt;\r\n	&lt;li&gt;Spoken English and computer facilities for all Students.&lt;/li&gt;\r\n	&lt;li&gt;Separate hostel for boys/girls with 24 hours security.&lt;/li&gt;\r\n	&lt;li&gt;Transport facility for students.&lt;/li&gt;\r\n	&lt;li&gt;External/Internal examiners system for conducting the practical &amp;amp; test examinations and &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;end Semester examinations by the University.&lt;/li&gt;\r\n	&lt;li&gt;The college holds extra revision classes and doubt clear classes during the holidays and &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;Sundays.&lt;/li&gt;\r\n	&lt;li&gt;The college has well equipped library and reading room with good number of latest &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;textbooks, reference books &amp;amp; journals for the students.&lt;/li&gt;\r\n	&lt;li&gt;Moot courts and seminars at least twice in each semester.&lt;/li&gt;\r\n	&lt;li&gt;Attending the courts and Advocate&amp;rsquo;s chamber.&lt;/li&gt;\r\n	&lt;li&gt;Participation of students at State and National level Moot Court Competitions and &amp;nbsp;&amp;nbsp;seminars organized by the Indian Law Institute, Bar Council of India and other Universities.&lt;/li&gt;\r\n	&lt;li&gt;Special training for Odisha Judicial Service Examinations and other Examinations.&lt;/li&gt;\r\n	&lt;li&gt;Placement facility&lt;/li&gt;\r\n	&lt;li&gt;Conducting programmes like Legal Aid, Red Cross and N.S.S. Camps.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', 'Text', 1, 1),
