h Room dimension=20ïƒ40 ft.&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td colspan=&quot;2&quot;&gt;\r\n			&lt;p&gt;Legal Aid&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td colspan=&quot;3&quot;&gt;\r\n			&lt;p&gt;10 Legal Aid Camps were conducted during last year&amp;rsquo;s.&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td colspan=&quot;2&quot;&gt;\r\n			&lt;p&gt;Moot Court&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td colspan=&quot;3&quot;&gt;\r\n			&lt;p&gt;Participation of students at State and National level Moot Court Competitions.&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td colspan=&quot;2&quot;&gt;\r\n			&lt;p&gt;Nearest distance between the Institution and the District/ High Court.&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td colspan=&quot;3&quot;&gt;\r\n			&lt;p&gt;Three KM&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td colspan=&quot;2&quot;&gt;\r\n			&lt;p&gt;Photograph of frontal view of the College Building&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td&gt;\r\n			&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n			&lt;/td&gt;\r\n			&lt;td colspan=&quot;3&quot;&gt;\r\n			&lt;p&gt;Website&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n', 'Text', 1, 1),
(52, 36, '&lt;h2&gt;Key Features&lt;/h2&gt;\r\n\r\n&lt;ul class=&quot;list-icons&quot;&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; New Pattern qualitative teaching by highly experienced faculties &amp;amp; visiting faculties.&lt;/li&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; Highly qualified faculties.&lt;/li&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; Weekly Assessment Tests and Semester system Examinations (Two in a year) with the provision of Internal Assessment.&lt;/li&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; Clearing of doubts at any point of time.&lt;/li&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; Holding parent&amp;rsquo;s meetings.&lt;/li&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; Spoken English and computer facilities for all Students.&lt;/li&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; Separate hostel for boys/girls with 24 hours security.&lt;/li&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; Transport facility for students.&lt;/li&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; External/Internal examiners system for conducting the practical &amp;amp; test examinations and end Semester examinations by the University.&lt;/li&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; The college holds extra revision classes and doubt clear classes during the holidays and Sundays.&lt;/li&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; The college has well equipped library and reading room with good number of latest textbooks, reference books &amp;amp; journals for the students.&lt;/li&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; Moot courts and seminars at least twice in each semester.&lt;/li&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; Attending the courts and Advocate&amp;rsquo;s chamber.&lt;/li&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; Participation of students at State and National level Moot Court Competitions and &amp;nbsp;&amp;nbsp;seminars organized by the Indian Law Institute, Bar Council of India and other Universities.&lt;/li&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; Special training for Odisha Judicial Service Examinations and other Examinations.&lt;/li&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; Placement facility&lt;/li&gt;\r\n	&lt;li&gt;&lt;i class=&quot;icon-check&quot;&gt;&lt;/i&gt; Conducting programmes like Legal Aid, Red Cross and N.S.S. Camps.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', 'Text', 2, 1),
(53, 45, '&lt;div class=&quot;row&quot;&gt;\r\n&lt;div class=&quot;col-md-4&quot;&gt;\r\n&lt;div class=&quot;image-box mb-20 object-non-visible animated object-visible fadeInLeft&quot;&gt;\r\n&lt;div class=&quot;overlay-container&quot;&gt;&lt;img alt=&quot;&quot; src=&quot;assets/img/Secretary.jpg&quot; /&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;image-box-body&quot;&gt;\r\n&lt;p style=&quot;text-align:center&quot;&gt;Late Dr. Nalani Kant Samanta&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;col-md-8&quot;&gt;\r\n&lt;blockquote&gt;\r\n&lt;p style=&quot;font-size:22px; font-family: &#039;Marck Script&#039;, cursive;&quot;&gt;I would like to welcome our professional students and take this opportunity to thank you for showing your interest in our academic and professional programmes for Legal Studies. Our institution is strongly committed and determined towards academic excellence and professional growth. From our end, we aim to provide the finest environment possible for teaching and learning.Our taught programmed, backed by our highly qualified and experienced teachers. It gives the scope to provide students with opportunity to achieve their full potential in Legal Studies.&lt;/p&gt;\r\n&lt;/blockquote&gt;\r\n\r\n&lt;p style=&quot;text-align:right&quot;&gt;&lt;strong&gt;Late Dr. Nalani Kant Samanta&lt;/strong&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n', 'Text', 1, 1),
(54, 38, 'Content_38_1490681418.jpg', 'Image', 1, 1),
(55, 38, '&lt;p style=&quot;font-size:22px; font-family: &#039;Marck Script&#039;, cursive;&quot;&gt;I would like to welcome our professional students and take this opportunity to thank you for showing your interest in our academic and professional programmes for Legal Studies. Our institution is strongly committed and determined towards academic excellence and professional growth. From our end, we aim to provide the finest environment possible for teaching and learning.Our taught programmed, backed by our highly qualified and experienced teachers. It gives the scope to provide students with opportunity to achieve their full potential in Legal Studies.&lt;/p&gt;\r\n\r\n&lt;h3 style=&quot;text-align:right&quot;&gt;Mr. Saroj Kumar Samanta&lt;/h3&gt;\r\n', 'Text', 2, 1),
(56, 46, 'Content_46_1491047513.jpg', 'Image', 1, 1),
(57, 46, '&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;text-align: right;&quot;&gt;&lt;em&gt;&lt;strong&gt;Prof. (Dr.) N S JAGANADHA RAO&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\r\n', 'Text', 2, 1),
(59, 46, '&lt;p&gt;It gives me a great pleasure to welcome new students, their parents and family members to our legal institution Ganjam Law College. I am highly thankful to them for the confidence they vested on our legal institution. Our Ganjam Law College with qualified and experienced teaching staff committed for the welfare, progress and betterment of our students in legal field. Our teaching staff determined to provide best legal education with teaching, class seminars and Moot court competition. Our law college is having rich library with latest Text Books, journals and legal Souvenirs, Magazine and legal literature which is highly useful for students for their day to day study.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Our ex students are shining as university teaching staff, as advocates of High Courts and Supreme Court, legal officers and Judicial Officers.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; Our Non- teaching staff is well acquainted with all university rules and regulations.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; The efforts o9f our late director and founder of our law college, Dr. N. K. J. Samanta is giving strength to our staff to improve the standards of our legal institution. Our young Secretary Sri Saroj Kumar Samanta who is contributing hard work for the welfare of the Ganjam Law College is guiding the staff to work hard for progress of the institution.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; I extend my thanks and best wishes to new students, their parents on behalf of Ganjam Law College, teaching staff and management.&amp;nbsp;&lt;/p&gt;\r\n', 'Text', 3, 1);

